// Configures each driver bar
// @param graph | DOM element
// @param driver | Object
function drawDriver(graph, name, type, driver) {
  var height = getDriverHeight(driver.value);
  var cssKey = driver.key;
  var csstype = type;

  if (driver.key === 'hubs') {
    height = getSevenHeight(driver.value);
    cssKey = 'hub';
  }

  if (driver.key === 'aquatic') {
    height = getFiveHeight(driver.value);
    cssKey = 'fish';
  }

  if (driver.key === 'terrestrial') {
    height = getFiveHeight(driver.value);
    cssKey = 'wildlife';
  }

  if (driver.key === 'exposure') {
    height = getNineHeight(driver.value);
    cssKey = 'exposure-box';
  }

  if (driver.key === 'threat') {
    height = getThreatHeight(driver.value);
    cssKey = 'threat';
  }

  if (driver.key === 'asset') {
    height = getAssetHeight(driver.value);
    cssKey = 'asset';
  }

  if (driver.key === 'social-vulnerability') {
    height = getAssetHeight(driver.value);
    csstype = 'asset';
  }

  var roundedValue = parseInt(driver.value, 10);
  var roundedValueWord = numberToWord(roundedValue);

  var bar = graph.querySelector('.zonal-long-graph-bar-' + driver.key);

  var tooltipValue = Math.round(driver.value * 100) / 100;
  var toolTipword = numberToWord(roundedValue);

  if (bar) {
    bar.setAttribute('id', 'zonal-long-graph-bar-' + name);
    bar.style.height = formatPosition(height);
    if (name) {
      bar.classList.add('zonal-long-table-cell-' + cssKey + '-' + toolTipword);
      // } else {
      // bar.style.backgroundColor = getDriverColor(height);
    }

    bar.classList.add('driver-chart-backgroundColor-' + csstype + '-' + roundedValueWord);
    bar.setAttribute('title', '' + tooltipValue);
    bar.setAttribute('aria-label', '' + tooltipValue);
    bar.setAttribute('data-toggle', 'tooltip');
    bar.setAttribute('data-placement', 'top');
  }
}

